struct process {
uint32_t pid;
process_state_t state;
//     ^^^^^^^^^^^^
//     UNUSED=0, READY=1,
//     RUNNING=2, BLOCKED=3,
//     ZOMBIE=4
struct cpu_state *kernel_stack;
struct page_directory *page_directory;
uint32_t kernel_stack_top;
int priority;
uint64_t cpu_time;
uint64_t wake_time;  // for BLOCKED
struct process *next;  // run queue
};
